/**
 * Created by Basil on 04/04/20.
 */

import React from 'react';
import BoxComponent from '../General/BoxComponent';
const DashBoardDataComponent = () => {

    return (
    	<div>       
            <div className ="data-text">
               <h4> FreshTrak is here to help! </h4>
            </div>
            <div className="tile-box">
                <BoxComponent title = "Stay Up to Date" content = "Make a FreshTrak account to \nstay up to date on local \nfood access events." className ="stay-up-to-date"/>
            </div>
            <div className="tile-box">
                <BoxComponent title = "Pre-Register" content = "Make a FreshTrak account to\nstay up to date on local food\naccess events." className ="pre-register"/>
            </div>
            <div className="tile-box">
                <BoxComponent title = "Find Food" content = "Enter your zip code and get connected\nto food access resources in your\ncommunity" className ="find-food"/>
            </div>
        </div>
    )
};
export default DashBoardDataComponent;
